add_ocaml_element("lookup", "Program.lookup", "value", "('a, 'b) cls ->\n  Program.t -> tid -> 'b term option", "Bap.Std.Program.html#VALlookup", "<div class=\"info\">\n<code class=\"code\">lookup t program id</code> is like find but performs deep\n        lookup in the whole <code class=\"code\">program</code> for a term with a given <code class=\"code\">id</code>.\n</div>\n", ["AMORTIZED", "AMOUNT", "BUT", "COMPLEXITY", "DEEP", "FIND", "FOR", "FUNCTION", "GIVEN", "HAS", "LIKE", "LOOKUP", "MEMOIZED", "PERFORMS", "PROGRAM", "TERM", "TERMS", "THE", "THIS", "TOTAL", "WHERE", "WHOLE", "WITH", "WOSTCASE"]);
