add_ocaml_element("cata", "Term.cata", "value", "('p, 't) cls ->\n  init:'a ->\n  ?program:(program term -> 'a) ->\n  ?sub:(sub term -> 'a) ->\n  ?arg:(arg term -> 'a) ->\n  ?blk:(blk term -> 'a) ->\n  ?phi:(phi term -> 'a) ->\n  ?def:(def term -> 'a) ->\n  ?jmp:(jmp term -> 'a) -> 't term -> 'a", "Bap.Std.Term.html#VALcata", "<div class=\"info\">\n<code class=\"code\">cata cls ~init t ?case</code> performs a pattern matching.\n</div>\n", ["ALL", "CASE", "CATA", "CATAMORPHISM", "CLS", "DEFAULT", "FOR", "INIT", "MATCHING", "METHODS", "NOTE", "PATTERN", "PERFORMS", "RETURNS", "STANDS"]);
