add_ocaml_element("switch", "Term.switch", "value", "('p, 't) cls ->\n  program:(program term -> 'a) ->\n  sub:(sub term -> 'a) ->\n  arg:(arg term -> 'a) ->\n  blk:(blk term -> 'a) ->\n  phi:(phi term -> 'a) ->\n  def:(def term -> 'a) ->\n  jmp:(jmp term -> 'a) -> 't term -> 'a", "Bap.Std.Term.html#VALswitch", "<div class=\"info\">\n<code class=\"code\">switch cls t ~program ~sub .. ~jmp</code> performs a pattern\n        matching over a term <code class=\"code\">t</code> based on its type class <code class=\"code\">cls</code>.\n</div>\n", ["BASED", "CALLED", "CLASS", "CLS", "FOR", "FUNCTION", "GUARANTEED", "ITS", "JMP", "MATCHING", "ONE", "ONLY", "OVER", "PATTERN", "PERFORMS", "PROGRAM", "SUB", "SWITCH", "TERM", "THAT", "TYPE", "WILL"]);
