add_ocaml_element("nth_exn", "Term.nth_exn", "value", "('a, 'b) cls -> 'a Term.t -> int -> 'b Term.t", "Bap.Std.Term.html#VALnth_exn", "<div class=\"info\">\n<code class=\"code\">nth_exn t p n</code> same as <code class=\"code\">nth</code>, but raises exception if <code class=\"code\">n</code> is\n        not a valid position number.\n</div>\n", ["BUT", "EXCEPTION", "NOT", "NTH", "NTH_EXN", "NUMBER", "POSITION", "RAISES", "SAME", "VALID"]);
