add_ocaml_element("prepend", "Term.prepend", "value", "('a, 'b) cls ->\n  ?before:tid ->\n  'a Term.t -> 'b Term.t -> 'a Term.t", "Bap.Std.Term.html#VALprepend", "<div class=\"info\">\n<code class=\"code\">prepend t ~before:this p c</code> returns the <code class=\"code\">p</code> with <code class=\"code\">c</code> inserted\n        before <code class=\"code\">this</code> term.\n</div>\n", ["ALL", "BEFORE", "BEGINNING", "BUT", "CASES", "DOESN", "HAS", "INSERT", "INSERTED", "JUST", "LEFT", "OCCUR", "OTHERWISE", "PREPEND", "RETURNED", "RETURNS", "SAME", "SEQUENCE", "SPECIFIED", "TERM", "THE", "THEN", "THIS", "TID", "UNSPECIFIED", "WITH"]);
