add_ocaml_element("after", "Term.after", "value", "('a, 'b) cls ->\n  ?rev:bool ->\n  'a Term.t -> tid -> 'b Term.t seq", "Bap.Std.Term.html#VALafter", "<div class=\"info\">\n<code class=\"code\">after t ?rev p tid</code> returns all subterms in term <code class=\"code\">p</code> that\n        occur after a term with a given <code class=\"code\">tid</code>.\n</div>\n", ["AFTER", "ALL", "ARE", "EMPTY", "EVALUATION", "GIVEN", "OCCUR", "OMITTED", "ORDER", "OTHERWISE", "RETURNED", "RETURNS", "REV", "REVERSED", "SEQUENCE", "SUBTERMS", "TERM", "TERMS", "THAT", "THE", "THEN", "THERE", "THEY", "TID", "TRUE", "WITH"]);
